import React, { useState, useEffect } from "react";
import axios from "axios";
import { Link } from "react-router-dom";
import EditContactButton from "../Button/EditContactButton";
import {CardContent, Grid, ListItem, Typography} from "@material-ui/core";
import SmsForm from "../SmsForm/SmsForm";

const ContactList = () => {
  const [users, setUser] = useState([]);

  useEffect(() => {
    loadUsers();
  }, []);

  const loadUsers = async () => {
    const result = await axios.get("http://localhost:3003/users");
    setUser(result.data.reverse());
  };

  const deleteUser = async id => {
    await axios.delete(`http://localhost:3003/users/${id}`);
    loadUsers();
  };

  return (
    <div className="container">
      <div className="col-10 mx-auto">
        <div className="row">
          <div className="col-6">
          <table class="table border shadow">
          <thead class="thead-dark">
            <tr>
              {/* <th scope="col">#</th> */}
              <th scope="col">Basic Info</th>
              <th scope="col">Company</th>
              <th></th>
            </tr>
          </thead>
          <tbody>
            {users.map((user, index) => (
              <tr>
                {/* <th scope="row">{index + 1}</th> */}
                <td>{user.fullName}</td>
                <td>{user.companyName}</td>
                <td>
                  <Link
                    class="btn btn-outline-primary mr-2"
                    to={`/users/edit/${user.id}`}
                  >
                    <EditContactButton />
                  </Link>
                  <Link
                    class="btn btn-outline-primary mr-2"
                    to={`/users/${user.id}`}
                  >
                    view
                  </Link>
                  <Link
                    class="btn btn-danger"
                    onClick={() => deleteUser(user.id)}
                  >
                    Delete
                  </Link>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
        </div>
        <div className="col-md-6 px-5">
          <div className="container mx-auto shadow p-5">
              {/* <div className="w-75 mx-auto shadow p-5"> */}
      <h1 className="text-center mb-4">Contact Details</h1>
        <Typography variant="h6" className="text-center mb-4" gutterBottom>
         <h1>fullName</h1></Typography>
         <Typography className="text-center" variant="subheading" gutterBottom>
         <p>Email</p>
         </Typography>
        <CardContent>

        <div className ="row "> 
        <div className ="col-md-8">
         <ListItem>

         <Grid item xs={6}> Full Name: </Grid>
           <Grid item xs={6}>fullName</Grid>
           </ListItem>
            <ListItem> <Grid item xs={6}> Company: </Grid>
           <Grid item xs={6}>companyName</Grid></ListItem>
           <ListItem> <Grid item xs={6}> Email: </Grid>
           <Grid item xs={6}>Email</Grid></ListItem>
          <ListItem> <Grid item xs={6}> Contact: </Grid>
           <Grid item xs={6}>phoneno</Grid></ListItem>
           <ListItem> <Grid item xs={6}> Address: </Grid>
           <Grid item xs={6}>Address</Grid></ListItem>
           </div>
           <div className="col-md-4">
             <SmsForm />
           </div>
           </div>
       </CardContent>

      </div>
              </div>
        </div>
        </div>
      </div>
    // </div>
  );
};

export default ContactList;
